let stockage = []

export default function selectCommande(currentRound, buffer) {
    for (var j = 0; j < 4; j++){
        let cond = true
        for (var i = 0; i < buffer.length; i++){
            console.log("boucle1", currentRound, buffer[i][1], buffer[i][0])
            if (currentRound+j === buffer[i][0]){
                stockage.push
                cond = false
            //console.log("order", currentOrder)
            }
        if (cond === true){
            stockage.push(0)
        }
        }
    }
    return stockage
}
